            selector: 'page-about',template:/*ion-inline-start:"/Users/zacharyjordan/GitHub/The-Cure-It-Project-App/src/pages/about/about.html"*/'<ion-header>\n  <ion-navbar>\n    <ion-icon class = "information-button" name=\'information-circle\' on-tap="informationOpen()"></ion-icon>\n    <ion-title>\n      Stories\n    </ion-title>\n  </ion-navbar>\n</ion-header>\n\n<ion-content padding>\n  <ion-card>\n    <ion-item>\n      <h2>Lisa Miller</h2>\n      <p class = "move-left">Hodgkin\'s Lymphoma</p>\n    </ion-item>\n    <ion-card-content class = "ion-card-content">\n      <p> Hodgkin\'s Disease attacks the same area that Non-Hodgkin\'s Lymphoma does: the lymphocytes. Hodgkin\'s Disease takes over these cells, and in doing so weakens the immune system.</p>\n    </ion-card-content>\n\n    <button ion-button primary clear small on-tap = "expandLisa()">\n          <ion-icon class = "push-icon-right"name="paper"></ion-icon>\n          <div>Read Story</div>\n        </button>\n\n        <button ion-button primary clear small on-tap = "expandLymphatic()">\n          <ion-icon class = "push-icon-right"name="medkit"></ion-icon>\n          <div>Lymphatic Cancer</div>\n        </button>\n  </ion-card>\n\n <ion-card>\n    <ion-item>\n      <h2>Christina Shaw</h2>\n      <p class = "move-left">Lung Cancer</p>\n    </ion-item>\n    <ion-card-content class = "ion-card-content">\n      <p> More people die from Lung Cancer than Colon, Breast, and Prostate Cancers combined.</p>\n    </ion-card-content>\n\n   <button ion-button primary clear small on-tap = "expandChristina()">\n          <ion-icon class = "push-icon-right"name="paper"></ion-icon>\n          <div>Read Story</div>\n        </button>\n\n        <button ion-button primary clear small on-tap = "expandLung()">\n          <ion-icon class = "push-icon-right"name="medkit"></ion-icon>\n          <div>Lung Cancer</div>\n        </button>\n  </ion-card>\n\n  <ion-card>\n    <ion-item>\n      <h2>Allie Weaver</h2>\n      <p class = "move-left">Hodgkin\'s Lymphoma</p>\n    </ion-item>\n    <ion-card-content class = "ion-card-content">\n      <p>Non-Hodgkin\'s Lymphoma (sometimes referred to as NHL) is far more common than Hodgkin\'s Disease, with around 8 cases documented for every one case of Hodgkin\'s Disease.</p>\n    </ion-card-content>\n\n   <button ion-button primary clear small on-tap = "expandAllie()">\n          <ion-icon class = "push-icon-right"name="paper"></ion-icon>\n          <div>Read Story</div>\n        </button>\n\n        <button ion-button primary clear small on-tap = "expandLymphatic()">\n          <ion-icon class = "push-icon-right"name="medkit"></ion-icon>\n          <div>Lymphatic Cancer</div>\n        </button>\n  </ion-card>\n\n  <ion-card>\n    <ion-item>\n      <h2>Komi Amegblenke</h2>\n      <p class = "move-left">High-Grade Lymphoma</p>\n    </ion-item>\n    <ion-card-content class = "ion-card-content">\n      <p> Once white blood cells are mutated through Lymphatic Cancers, the body begins to have difficulty fighting off even small viruses like mild colds. This has the effect of turning mild conditions into severe medical crises.</p>\n    </ion-card-content>\n\n   <button ion-button primary clear small on-tap = "expandKomi()">\n          <ion-icon class = "push-icon-right"name="paper"></ion-icon>\n          <div>Read Story</div>\n        </button>\n\n        <button ion-button primary clear small on-tap = "expandLymphatic()">\n          <ion-icon class = "push-icon-right"name="medkit"></ion-icon>\n          <div>Lymphatic Cancer</div>\n        </button>\n  </ion-card>\n\n  <ion-card>\n    <ion-item>\n      <h2>Shobi Lussier</h2>\n      \n      <p class = "move-left">Bone Cancer</p>\n    </ion-item>\n    <ion-card-content class = "ion-card-content">\n      <p>A danger that comes with this cancer is that it can easily metastasize, or spread, around the body. Since bones exist in practically every system and area of the body, this disease has the potential to be spread almost anywhere. </p>\n    </ion-card-content>\n\n   <button ion-button primary clear small on-tap = "expandShobi()">\n          <ion-icon class = "push-icon-right"name="paper"></ion-icon>\n          <div>Read Story</div>\n        </button>\n\n        <button ion-button primary clear small on-tap = "expandBone()">\n          <ion-icon class = "push-icon-right"name="medkit"></ion-icon>\n          <div>Bone Cancer</div>\n        </button>\n  </ion-card>\n\n   <ion-card>\n    <ion-item>\n      <h2>Jake Samson</h2>\n      \n      <p class = "move-left">Testicular Cancer</p>\n    </ion-item>\n    <ion-card-content class = "ion-card-content">\n      <p>This is an extremely rare form of cancer, occuring in less than half a percent of males in a given year. Despite this, Testicular Cancer is currently the most common form of cancer found in men between the ages of 15 and 35. </p>\n    </ion-card-content>\n\n   <button ion-button primary clear small on-tap = "expandJake()">\n          <ion-icon class = "push-icon-right"name="paper"></ion-icon>\n          <div>Read Story</div>\n        </button>\n\n        <button ion-button primary clear small on-tap = "expandTesticular()">\n          <ion-icon class = "push-icon-right"name="medkit"></ion-icon>\n          <div>Testicular Cancer</div>\n        </button>\n  </ion-card>\n\n  <span class = "center-button-wrapper">\n    <a class = "allie-link" href="mailto:topboxsoftware@gmail.com?Subject=Sharing%20A%20Story" target="_top">\n      <button class = "center-button" ion-button large >Share Your Story</button>\n    </a>\n</span>\n</ion-content>\n'/*ion-inline-end:"/Users/zacharyjordan/GitHub/The-Cure-It-Project-App/src/pages/about/about.html"*/
